import ExpenseItem from "./components/Expenses/ExpenseItem.js";

function App() {
  let expense = [
    {
      id: "1",
      expenseDate: new Date(2023, 6, 24),
      expenseTitle: "School Fee",
      expenseAmount: 300,
    },
    {
      id: "2",
      expenseDate: new Date(2023, 6, 24),
      expenseTitle: "School Fee",
      expenseAmount: 300,
    },
    {
      id: "3",
      expenseDate: new Date(2023, 6, 24),
      expenseTitle: "School Fee",
      expenseAmount: 300,
    },
    {
      id: "4",
      expenseDate: new Date(2023, 6, 24),
      expenseTitle: "School Fee",
      expenseAmount: 300,
    },
  ];

  return (
    <div>
      <ExpenseItem
        date={expenseDate}
        title={expenseTitle}
        amount={expenseAmount}
      />
    </div>
  );
}

export default App;
